import logo from './logo.svg';
import codecademyLogo from './codecademy-logo.png'
import { getValue } from '@testing-library/user-event/dist/utils';

//variable
let characteristics = ["Weapon Skill (WS)", "Ballistic Skill (BS)", "Strength (S)", "Toughness (T)", "Agility (Ag)", "Intelligence (Int)", "Perception (Per)", "Willpower (WP)", "Fellowship (Fel)"];
let characteristicsValues = [46, 44, 60, 50, 34, 53, 41, 38, 37]
let characteristicsAdvToken = ["[*][*][ ][ ]", "[*][*][ ][ ]", "[*][*][ ][ ]", "[*][*][ ][ ]", "[*][ ][ ][ ]", "[*][*][*][ ]", "[ ][ ][ ][ ]", "[][][][]", "[][][][]"]

//Function HTML section
function Content01() {
  return (
    <div
      id="startSection01"
      className="Main-Content"
      style={{ fontWeight: "500", height: "100vh", Margin: "50px,10px" }}
      data-aos="fade-right"
      data-aos-anchor-placement="top-center"
      data-aos-duration="1000"
    // data-aos-offset="0"
    >
      <div className='characteristics'>
        <h1>Characteristics</h1>
        <div className='characteristics01'><p><span className='characteristicsName'><label>{characteristics[0]}:</label></span><span className='characteristicsValue'> {characteristicsValues[0]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics02'><p><span className='characteristicsName'><label>{characteristics[1]}:</label></span><span className='characteristicsValue'> {characteristicsValues[1]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics03'><p><span className='characteristicsName'><label>{characteristics[2]}:</label></span><span className='characteristicsValue'> {characteristicsValues[2]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics04'><p><span className='characteristicsName'><label>{characteristics[3]}:</label></span><span className='characteristicsValue'> {characteristicsValues[3]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics05'><p><span className='characteristicsName'><label>{characteristics[4]}:</label></span><span className='characteristicsValue'> {characteristicsValues[4]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics06'><p><span className='characteristicsName'><label>{characteristics[5]}:</label></span><span className='characteristicsValue'> {characteristicsValues[5]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics07'><p><span className='characteristicsName'><label>{characteristics[6]}:</label></span><span className='characteristicsValue'> {characteristicsValues[6]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics08'><p><span className='characteristicsName'><label>{characteristics[7]}:</label></span><span className='characteristicsValue'> {characteristicsValues[7]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics09'><p><span className='characteristicsName'><label>{characteristics[8]}:</label></span><span className='characteristicsValue'> {characteristicsValues[8]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
        <div className='characteristics10'><p><span className='characteristicsName'><label>{characteristics[9]}:</label></span><span className='characteristicsValue'> {characteristicsValues[9]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[0]}</span></p></div>
      </div>
    </div>
  );
}

export default Content01;
